import "../static/index.css"
import Head from 'next/head'

function HomePage() {
    return (
        <div>
            <Head>
                <title>My page title</title>
                <meta name="viewport" content="initial-scale=1.0, width=device-width" />
            </Head>
            <Nav></Nav>
            <div className="body">

            </div>
            Welcome to Next.js!
        </div>
        )
}


<style jsx global>{`
    .body{
        background:green;
    }
`}</style>
export default HomePage
